import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <div class="container">
      <h1>Task Tracker</h1>
      <p>Welcome to the Task Tracker application!</p>
    </div>
  `,
  styles: [`
    .container {
      text-align: center;
      margin-top: 50px;
    }
  `]
})
export class AppComponent {
  title = 'task-tracker-frontend';
}
